" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Fusarium pneumonia CT",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 400px; height: 377px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Right-sided lung nodule caused by Fusarium spp. The patient was a 43-year-old male with acute myelogenous leukemia who had undergone allogeneic hematopoietic cell transplantation and presented with persistent fevers while neutropenic despite broad-spectrum antibiotics.",
