" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 526px\">",
"   <div class=\"ttl\">",
"    Scalp pressure dressing",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 506px; height: 679px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Hemostasis of deep scalp wounds may be provided by placement of a scalp pressure dressing. The wound is covered with topical antibiotic ointment and sterile gauze (figure A) and then the head is tightly wrapped circumferentially with a gauze roll and secured with tape (figure B).",
