"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     1% (118 mL): $6.59",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Lotion",
"     </b>",
"     (Calaclear External)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     1-0.1% (177 mL): $3.74",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Lotion",
"     </b>",
"     (Caladryl Clear External)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     1-0.1% (177 mL): $4.66",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Lotion",
"     </b>",
"     (Callergy Clear External)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     1-0.1% (177 mL): $4.12",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Lotion",
"     </b>",
"     (Prax External)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     1% (118 mL): $19.07",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Lotion",
"     </b>",
"     (Sarna Sensitive External)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     1% (222 mL): $7.80",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Misc",
"     </b>",
"     (Prax External)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     1% (1): $0.70",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F5539918\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Anugesic (ZA);",
"     </li>",
"     <li>",
"      Nestosyl (NL);",
"     </li>",
"     <li>",
"      Primoly Gel (TH);",
"     </li>",
"     <li>",
"      Sarmed (IL);",
"     </li>",
"     <li>",
"      Tronotene (IT);",
"     </li>",
"     <li>",
"      Tronothane (FR)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F212448\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Pramoxine, like other anesthetics, decreases the neuronal membrane's permeability to sodium ions; both initiation and conduction of nerve impulses are blocked, thus depolarization of the neuron is inhibited",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F212460\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:0em;text-align:justify;display:inline\">",
"     Onset of action: 3-5 minutes",
"    </p>",
"   </div>",
"  </div>",
