var title_f17_5_17496="Sites LV measurements";
var content_f17_5_17496=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F68362%7ECARD%2F70139&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F68362%7ECARD%2F70139&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Sites for left ventricular measurements",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 282px; height: 360px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Measurements of left ventricular (LV) dimensions can be obtained from various views obtained from the 2 dimensional echocardiogram. Panel A is the apical four chamber view; M-mode tracings cannot be made from an apical view and thus measurements must be made directly from the two dimensional image. The dimensions of the right ventricle (RV) can also be obtained from this view. Panel B is the short axis precordial view; measurements from the short axis can be made interchangeably from either M-mode or two dimensional image. Panel C is the long axis precordial view; measurements of LV dimension can be made from either the two dimensional image or the M-mode tracing.",
"    <div class=\"footnotes\">",
"     Ao: aorta; LA: left atrium; RA: right atrium.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 494px\">",
"   <div class=\"ttl\">",
"    Algorithms of quanitative two-dimensional echocardiography",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 474px; height: 554px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are seven algorithms used in the planimetric assessment of left ventricular (LV) volume from tomographic images of the LV. The shaded areas represent the portions of the images of the LV that must be obtained and planimetered in order to satisfy the requirements of the various algorithms. Algorithm I (modified Simpson's rule or method of discs), IV (biplane area length), or VII (single plane area length) are most often used; however, whenever possible algorithm I, now called the method of discs, is used.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Dr. Norman H Silverman.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
