" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Benefits and risks of caffeine and caffeinated beverages",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?17/5/17498/contributors\">",
