var title_f17_5_17499="Intermittent IP dosing in APD 2010";
var content_f17_5_17499=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F74934&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F74934&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Intermittent dosing of antibiotics in automated peritoneal dialysis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        IP dose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cefazolin",
"       </td>",
"       <td>",
"        20 mg/kg IP each day, in long day dwell",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cefepime",
"       </td>",
"       <td>",
"        1 g IP in one exchange per day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fluconazole",
"       </td>",
"       <td>",
"        200 mg IP in one exchange per day, every 24-48 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tobramycin",
"       </td>",
"       <td>",
"        LD 1.5 mg/kg IP in long dwell, then 0.5 mg/kg IP each day, in long dwell",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vancomycin",
"       </td>",
"       <td>",
"        LD 30 mg/kg IP in long dwell; repeat dosing 15 mg/kg IP in long dwell every 3-5 days (adjust interval to maintain serum trough levels above 15 &micro;g/mL)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     IP: intraperitoneal; LD: loading dose.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Li, PK, Szeto, CC, Piraino, B, et al. Peritoneal Dialysis-Related Infections Recommendations: 2010 Update. Perit Dial Int 2010; 30:393. Published in Peritoneal Dialysis International. Copyright &copy; 2010.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
