var title_f17_5_17500="X linked agammaglobulinemia";
var content_f17_5_17500=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F75514&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F75514&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnostic criteria for x-Linked agammaglobulinemia (XLA)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Definitive diagnosis*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Male patient with less than 2 percent CD19+ B cells and at least one of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Mutation in Btk.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Absent Btk mRNA on Northern blot analysis of neutrophils or",
"monocytes.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Absent Btk protein in monocytes or platelets.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        4. Maternal",
"cousins, uncles, or nephews with less than 2 percent CD19+ B cells.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Probable diagnosis*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Male patient with less than 2 percent CD19+ B cells in whom all of the following are positive:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Onset of recurrent bacterial infections in the first 5 years of life.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Serum IgG, IgM, and IgA more than 2 SD below normal for age.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3.",
"Absent isohemagglutinins and/or poor response to vaccines..",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        4. Other",
"causes of hypogammaglobulinemia have been excluded.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Possible diagnosis*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Male patient with less than 2 percent CD19+",
"B cells in whom other causes of hypogammaglobulinemia have been",
"excluded and at least one of the following is positive:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Onset of recurrent bacterial infections in the first 5 years of life.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Serum IgG, IgM, and IgA more than 2 SD below normal for age.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Absent isohemagglutinins.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Patients with a definitive or probable diagnosis are assumed to have a greater than 98 and 85 percent probability, respectively, that in 20 years they will still have the same diagnosis. Patients with a possible diagnosis are those that have some but not all of the characteristic clinical or laboratory findings of a particular disorder.",
"    </div>",
"    <div class=\"reference\">",
"     From Conley, ME, Notarangelo, LD, Etzioni, A. Clin Immunol 1999; 93:190.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
