var title_f17_5_17501="Prior angina influences outcome after anterior MI";
var content_f17_5_17501=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F81307&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F81307&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Angina within 24 hours of an acute anterior MI improves outcome",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 305px; height: 230px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Prodromal angina within 24 hours of an acute anterior wall myocardial infarction is associated with a better in-hospital and five-year survival compared to patients not having angina within this period (p = 0.009). Previous angina more remote from the MI had no effect on survival.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Ishihara, M, Sato, H, Tateishi, H, et al. J Am Coll Cardiol 1997; 30:970.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
